class Solution {
  List<int> findMissingAndRepeatedValues(List<List<int>> grid) {
    int n = grid.length;
    int size = n * n;
    List<bool> seen = List.filled(size + 1, false);
    int? repeated;  // Nullable, as we don't know the value initially
    int? missing;   // Nullable, as we don't know the value initially

    // Iterate through the grid to find the repeated number
    for (var row in grid) {
      for (var num in row) {
        if (seen[num]) {
          repeated = num;
          break;
        }
        seen[num] = true;
      }
      if (repeated != null) break; // Stop iterating if repeated number is found
    }

    // Find the missing number
    for (int i = 1; i <= size; i++) {
      if (!seen[i]) {
        missing = i;
        break;
      }
    }

    // Assuming the input is always valid, so both repeated and missing will be non-null
    return [repeated!, missing!];
  }
}
